import * as types from "./actiontypes";

import axios from "axios";

//Add any dispatches that send data to a reducer below
export const allBucketList = (data) => ({
  type: types.BUCKETLIST,
  bucketList:data
});

export const dispatchGetAllBuckets = () => {
  return function(dispatch, getState) {
    axios.get('http://localhost:8011/getAllBuckets').then((data)=>{
      console.log(data);
      dispatch(allBucketList(data.data.data))
    }).catch((error)=>{
      console.log(error)
    })
  };
}
export const dispatchBucket = (bucketName,listItems) => {
  return function(dispatch, getState) {
    axios.post('http://localhost:8011/addBucket',{bucketName:bucketName}).then((data)=>{
      console.log(data);
      let t = [...listItems];
      dispatch(allBucketList(t.push(data.data.data)))
    }).catch((error)=>{
      console.log(error)
    })
  };
}
